import React, { Component } from 'react';

class PerfumePage extends Component {

  render() {
    return (
      <div>
        <h1 className="main-title">Eau De</h1>
        <img className='frame' src="./YeroldsFrame.jpg"/>
        <h1 id="yerold">Yerold</h1>
        <div className='ui grid'>
          <PerfumeContainer className='twelve wide column' perfumes={this.props.perfumes}/>
          <Cart className='four wide column' perfumes={this.props.perfumes}/>
        </div>
      </div>
    );
  }

}

export default PerfumePage;
